import React from 'react';
import ResumeContent from './ResumeContent';
import Draggable from './../Draggable/Draggable';
import './Resume.css';

class Gallery extends React.Component {


    render() {
        return(
          <div className="resume-page-container parallax">
              <h1>R&eacute;sum&eacute;</h1>
              <div className="paper">
                  <ResumeContent/>
              </div>
              <Draggable x={250} y={600} className="sticky-text" contentEditable="true">
                  {/*Note: The 'sticky' class CSS is located in '~/assets/Theme.css'*/}
                  <div className="sticky">
                      <div className="sticky-text" contentEditable="true" spellCheck="false">
                          Move Me! <br/><br/>
                          Feel free to take notes in this area.
                      </div>
                  </div>
              </Draggable>
          </div>
        )
    }
}

export default Gallery
